import { render, screen, fireEvent } from '@testing-library/react';
import user from '@testing-library/user-event';
import '@testing-library/jest-dom';
import { BrowserRouter } from 'react-router-dom';
import Merge from '../Merge';

describe('Tests for API calls', () => {
	render(<Merge />);

	it('Test for merge files', () => {
		const str1 = "";

		const str2 = "";
		
		const blob = new Blob([str1]);
		const blob2 = new Blob([str2]);

		const file = new File([blob], 'file_name_1.pdf', {
			type: 'application/pdf'
		});
		const file2 = new File([blob2], 'file_name_2.pdf', {
			type: 'application/pdf'
		});

		const input = screen.getByTestId('merge-input');
		user.upload(input, file);
		user.upload(input, file2);

		const btn = screen.getByTestId(/merge-btn/i); 
		fireEvent.click(btn);

		expect(screen.getByText(/Download/i)).toBeInTheDocument();

	});
	
});





